import React from 'react';
import Car from '@components/Car';
import Card from '@components/Card';

import { useRouter } from 'next/router';

export default function index() {
    const router = useRouter();

    return (
        <div>
            <div className="py-28 lg:mt-0 md:mt-0 mt-14">
                <div className="top-0 bg-white h-24 w-full fixed my-24 shadow-lg">
                    <div className="flex justify-center items-center w-full h-24">
                        <div className="bg-gray-200 h-10 rounded-full w-1/3 flex">
                            <div>serach</div>
                            <input type="text" className=" bg-transparent w-2/3" />
                        </div>
                    </div>
                </div>
                <Card data={Car} />
            </div>
        </div>
    );
}
